const onLoad = () => {
  const style = document.createElement("style");
  style.type = "text/css";
  const css = `@font-face {
  font-family: 'FBKINGDOM-FONT';
  src: url(data:font/otf;base64,);
}

* {
  font-family: 'FBKINGDOM-FONT',"Segoe UI",Meiryo,system-ui,-apple-system,BlinkMacSystemFont,sans-serif !important;
}`;
  style.appendChild(document.createTextNode(css));
  document.head.appendChild(style);
};

onLoad();
